import { SWAPI_ROOT, SWAPI_PEOPLE } from '../constants/api';

export function getId(url, category) {
    const id = url.replace(SWAPI_ROOT+category, '');
    return id;
}

export function getPeopleId(url) {
    getId(url, SWAPI_PEOPLE);
}
